import React from 'react';
import Layout from '../components/Layout';
import styled  from 'styled-components';



const Index = ({children}) => (
    <>
        <Layout /> 
        {children}
        <div className="container-flow">
            <div className="row">
                <div className="col-12 img-wide"></div>
                
            </div>
        </div>
    </>
   
  )
  
  export default Index
